import React, { useEffect } from 'react';
import { getAllOsoby } from './services/api';

const App = () => {
    useEffect(() => {
        const fetchData = async () => {
            try {
                const osoby = await getAllOsoby();
                console.log('Osoby:', osoby);
            } catch (error) {
                console.error('Błąd podczas pobierania osób:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            {/* Twój reszta kodu komponentu */}
        </div>
    );
};

export default App;
